var grobjects = grobjects || [];

// var skyboxrm;

var SkyBox = undefined;

(function() {
	"use strict";

	var urls = [
			"data:image/jpeg;base64,",
			"data:image/jpeg;base64,",
			"data:image/jpeg;base64,",
			"data:image/png;base64,",
			"data:image/jpeg;base64,",
			"data:image/jpeg;base64,"
		];

	var vertexSource = ""+
	"uniform mat4 projection;"+
	"uniform mat4 view;"+
	"uniform mat4 model;"+
	"attribute vec3 coords;"+
	"varying vec3 vCoords;"+
	"void main() {"+
	"   vec4 eyeCoords = view * model * vec4(coords,1.0);"+
	"   gl_Position = projection * eyeCoords;"+
	"   vCoords = coords;"+
	"}";

	var fragmentSource = "" +
	"precision mediump float;"+
	"varying vec3 vCoords;"+
	"uniform samplerCube skybox;"+
	"void main() {"+
	"     gl_FragColor = textureCube(skybox, vCoords);"+
	"}";

	var makeCube = function (side) {
		var s = (side || 1)/2;
		var coords = [];
		var normals = [];
		var texCoords = [];
		var indices = [];
		function face(xyz, nrm) {
				var start = coords.length/3;
			var i;
				for (i = 0; i < 12; i++) {
					coords.push(xyz[i]);
				}
				for (i = 0; i < 4; i++) {
					normals.push(nrm[0],nrm[1],nrm[2]);
				}
				texCoords.push(0,0,1,0,1,1,0,1);
				indices.push(start,start+1,start+2,start,start+2,start+3);
		}
		face( [-s,-s,s, s,-s,s, s,s,s, -s,s,s], [0,0,1] );
		face( [-s,-s,-s, -s,s,-s, s,s,-s, s,-s,-s], [0,0,-1] );
		face( [-s,s,-s, -s,s,s, s,s,s, s,s,-s], [0,1,0] );
		face( [-s,-s,-s, s,-s,-s, s,-s,s, -s,-s,s], [0,-1,0] );
		face( [s,-s,-s, s,s,-s, s,s,s, s,-s,s], [1,0,0] );
		face( [-s,-s,-s, -s,-s,s, -s,s,s, -s,s,-s], [-1,0,0] );
		return {
				vpos: new Float32Array(coords),
				vnormal: new Float32Array(normals),
				vtex: new Float32Array(texCoords),
				indices: new Uint16Array(indices)
		}
	}


	var makeTexture = function(gl, urls) {
		var ct = 0;
		var img = new Array(6);
		var texture = gl.createTexture();
		for (var i = 0; i < 6; i++) {
			img[i] = new Image();
			img[i].onload = function() {
				ct++;
				if (ct == 6) {
					gl.bindTexture(gl.TEXTURE_CUBE_MAP, texture);
					var targets = [
						 gl.TEXTURE_CUBE_MAP_POSITIVE_X, gl.TEXTURE_CUBE_MAP_NEGATIVE_X, 
						 gl.TEXTURE_CUBE_MAP_POSITIVE_Y, gl.TEXTURE_CUBE_MAP_NEGATIVE_Y, 
						 gl.TEXTURE_CUBE_MAP_POSITIVE_Z, gl.TEXTURE_CUBE_MAP_NEGATIVE_Z 
					];
					for (var j = 0; j < 6; j++) {
						gl.texImage2D(targets[j], 0, gl.RGBA, gl.RGBA, gl.UNSIGNED_BYTE, img[j]);
						gl.texParameteri(gl.TEXTURE_CUBE_MAP, gl.TEXTURE_WRAP_S, gl.CLAMP_TO_EDGE);
						gl.texParameteri(gl.TEXTURE_CUBE_MAP, gl.TEXTURE_WRAP_T, gl.CLAMP_TO_EDGE);
					}
					gl.generateMipmap(gl.TEXTURE_CUBE_MAP);
				}
			}
			img[i].src = urls[i];
		}
		gl.bindTexture(gl.TEXTURE_CUBE_MAP, null);
		return texture;
	}

	var createGLShader = function (gl, type, src) {
		var shader = gl.createShader(type)
		gl.shaderSource(shader, src);
		gl.compileShader(shader);
		if(!gl.getShaderParameter(shader, gl.COMPILE_STATUS)){
			console.log("warning: shader failed to compile!")
			console.log(gl.getShaderInfoLog(shader));
			return null;
		}
		return shader;
	}

	var createGLProgram = function (gl, vSrc, fSrc) {
		var program = gl.createProgram();
		var vShader = createGLShader(gl, gl.VERTEX_SHADER, vSrc);
		var fShader = createGLShader(gl, gl.FRAGMENT_SHADER, fSrc);
		gl.attachShader(program, vShader);
		gl.attachShader(program, fShader);
		gl.linkProgram(program);

		if(!gl.getProgramParameter(program, gl.LINK_STATUS)){
			console.log("warning: program failed to link");
			return null;
		}
		return program;
	}

	var createArrayGLBuffer = function (gl, data, usage) {
		var buffer = gl.createBuffer();
		gl.bindBuffer(gl.ARRAY_BUFFER, buffer);
		gl.bufferData(gl.ARRAY_BUFFER, data, usage);
		gl.bindBuffer(gl.ARRAY_BUFFER, null);
		return buffer;
	}

	var createElementArrayGLBuffer = function (gl, data, usage) {
		var buffer = gl.createBuffer();
		gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, buffer);
		gl.bufferData(gl.ELEMENT_ARRAY_BUFFER, data, usage);
		gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, null);
		return buffer;
	}

	var findAttribLocations = function (gl, program, attributes) {
		var out = {};
		for(var i = 0; i < attributes.length;i++){
			var attrib = attributes[i];
			out[attrib] = gl.getAttribLocation(program, attrib);
		}
		return out;
	}

	var findUniformLocations = function (gl, program, uniforms) {
		var out = {};
		for(var i = 0; i < uniforms.length;i++){
			var uniform = uniforms[i];
			out[uniform] = gl.getUniformLocation(program, uniform);
		}
		return out;
	}

	var enableLocations = function (gl, attributes) {
		for(var key in attributes){
			var location = attributes[key];
			gl.enableVertexAttribArray(location);
		}
	}

	var disableLocations = function (gl, attributes) {
		for(var key in attributes){
			var location = attributes[key];
			gl.disableVertexAttribArray(location);
		}
	}

	var SkyBox = function SkyBox(name, position, size, color, theta) {
		this.name = name;
		this.position = position || [0,0,0];
		this.size = size || 1.0;
		this.color = color || [1,1,0];
		this.theta = theta || 0;
		this.program = null;
		this.attributes = null;
		this.uniforms = null;
		this.buffers = [null, null, null, null];
		this.texturesb = null;
		this.shape = null;
		this.rotator = null;
	}

	SkyBox.prototype.init = function(drawingState) {
		var gl = drawingState.gl; 
		
		this.program = createGLProgram(gl, vertexSource, fragmentSource);
		this.attributes = findAttribLocations(gl, this.program, ["coords"]);
		this.uniforms = findUniformLocations(gl, this.program, ["projection", "model" ,"view","skybox"]);

		this.texturesb = makeTexture(gl, urls);

		this.shape = makeCube(200);

		// this.rotator = new SimpleRotator(drawingState.canvas,this.draw);
	//       this.rotator.setView( [0,0,1], [0,1,0], 5 );

		this.buffers[0] = createArrayGLBuffer(gl, this.shape.vpos, gl.STATIC_DRAW);
		this.buffers[1] = createArrayGLBuffer(gl, this.shape.vnormal, gl.STATIC_DRAW);
		this.buffers[2] = createArrayGLBuffer(gl, this.shape.vtex, gl.STATIC_DRAW);
		this.buffers[3] = createElementArrayGLBuffer(gl, this.shape.indices, gl.STATIC_DRAW);
	}

	SkyBox.prototype.draw = function(drawingState) {
		
		var gl = drawingState.gl; 
		gl.useProgram(this.program);

		gl.clearColor(0,0,0,1);
		gl.enable(gl.DEPTH_TEST);
		gl.clear(gl.COLOR_BUFFER_BIT | gl.DEPTH_BUFFER_BIT);
		
		// var modelview = this.rotator.getViewMatrix();
		var model = twgl.m4.scaling([this.size,this.size,this.size]);
		twgl.m4.setTranslation(model,this.position,model);
		var view = drawingState.view;
		var projection = drawingState.proj;
		// twgl.m4.setTranslation(modelview, [0, 0, -10], modelview);
		// var projection = twgl.m4.perspective( Math.PI/3, 1, 1, 2000);
		
		gl.uniformMatrix4fv(this.uniforms.projection, gl.FALSE, projection );
		gl.uniformMatrix4fv(this.uniforms.model, gl.FALSE, model );
		gl.uniformMatrix4fv(this.uniforms.view, gl.FALSE, view );
		gl.uniform1i(this.uniforms.skybox, 0 );

		// skyboxrm = this.texturesb;

		gl.activeTexture(gl.TEXTURE0);
		gl.bindTexture(gl.TEXTURE_CUBE_MAP, this.texturesb);

		enableLocations(gl, this.attributes);

		gl.bindBuffer(gl.ARRAY_BUFFER, this.buffers[0]);
		gl.vertexAttribPointer(this.attributes.coords, 3, gl.FLOAT, false, 0, 0);

		gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, this.buffers[3]);

		gl.drawElements(gl.TRIANGLES, this.shape.indices.length, gl.UNSIGNED_SHORT, 0);

		disableLocations(gl, this.attributes);

	}

	SkyBox.prototype.center = function(drawingState) {
		return this.position;
	}

	// grobjects.push(new SkyBox("SkyBox2",[0,3,4],.01) );
	// grobjects.push(new SkyBox("SkyBox3",[0,3,-4],.01) );
	grobjects.push(new SkyBox("SkyBox1",[0,0,0],1) );
	

})();



